const CACHE_NAME="bookmarks-pwa-v1",urlsToCache=["/","/share","/links"];self.addEventListener("install",(e=>{e.waitUntil(caches.open(CACHE_NAME).then((e=>(console.log("Opened cache"),e.addAll(urlsToCache)))).catch((e=>{console.log("Cache install error:",e)})))})),self.addEventListener("fetch",(e=>{e.respondWith(caches.match(e.request).then((t=>{if(t)return t;const n=e.request.clone();return fetch(n).then((t=>{if(!t||200!==t.status||"basic"!==t.type)return t;const n=t.clone();return caches.open(CACHE_NAME).then((t=>{t.put(e.request,n)})),t}))})))})),self.addEventListener("activate",(e=>{const t=[CACHE_NAME];e.waitUntil(caches.keys().then((e=>Promise.all(e.map((e=>{if(-1===t.indexOf(e))return caches.delete(e)}))))))}));